import React, { Component } from "react";

class FamilyInvite extends Component {
  state = {};
  render() {
    return (
      <div id="famSetInvWrapper">
        <div className="famSetInvHeader">Create 30 minute invite link</div>
      </div>
    );
  }
}

export default FamilyInvite;
